using System.Linq;
using Microsoft.AspNet.Mvc;
using Microsoft.Data.Entity;
using NeedleWork2016.Models;
using System.Security.Claims;
using NeedleWork2016.Core;
using NReco.PdfGenerator;
using System;
using System.Text.RegularExpressions;

namespace NeedleWork2016.Controllers
{
    public class NewPDFController : Controller
    {
        private float image1Width;
        private float image2Width;
        private float image3Width;
        private float image1Height;
        private float image2Height;
        private float image3Height;
        private float[] widthArray;
        private byte[] code1;
        private byte[] code2;
        private byte[] code3;

        private ApplicationDbContext _context;

        public NewPDFController(ApplicationDbContext context)
        {
            _context = context;
        }

        // GET: UsersPDFs/Create
        public byte[] CreatePDF(string[] srcImgData, string[] patternImgData, string[] report)
        {
            string inputdata1 = "";
            string inputdata2 = "";
            string inputdata3 = "";

            for (int i = 0; i < srcImgData.Length; i++)
            {
                inputdata1 = inputdata1 + srcImgData[i];
            }

            for (int j = 0; j < patternImgData.Length; j++)
            {
                inputdata2 = inputdata2 + patternImgData[j];
            }

            for (int k = 0; k < report.Length; k++)
            {
                inputdata3 = inputdata3 + report[k];
            }


            PDF pdf = new PDF();

            widthArray = new float[3];

            //string inputdata1 = "data:image/png;base64,";
            //string inputdata2 = "data:image/png;base64,";
            //string inputdata3 = "data:image/png;base64,";
            //string template = "data:image/png;base64,";

            PDFdata p = new PDFdata();

            string htmltext = System.IO.File.ReadAllText(@"PDFTemplate\PDFreport.cshtml");

            // processing of the 1st image


            string pattern = @"image1""(\s+)src=""""";

            string target = "image1\" src=\"" + inputdata1 + "\"";

            Regex regex = new Regex(pattern);

            htmltext = regex.Replace(htmltext, target);

            string pattern11 = @"\D*;base64,";

            Regex regex11 = new Regex(pattern11);

            inputdata1 = regex11.Replace(inputdata1, "");

            code1 = p.StringToCode(inputdata1);

            image1Width = p.GetImage(code1).Width;

            image1Height = p.GetImage(code1).Height;

            widthArray[0] = image1Width;


            // processing of the 2nd image

            string pattern1 = @"image2""(\s+)src=""""";

            string target1 = "image2\" src=\"" + inputdata2 + "\"";

            Regex regex1 = new Regex(pattern1);

            htmltext = regex1.Replace(htmltext, target1);

            inputdata2 = regex11.Replace(inputdata2, "");

            code2 = p.StringToCode(inputdata2);

            image2Width = p.GetImage(code2).Width;

            image2Height = p.GetImage(code2).Height;

            widthArray[1] = image2Width;


            // processing of the 3d image


            string pattern2 = @"image3""(\s+)src=""""";

            string target2 = "image3\" src=\"" + inputdata3 + "\"";

            Regex regex2 = new Regex(pattern2);

            htmltext = regex2.Replace(htmltext, target2);

            inputdata3 = regex11.Replace(inputdata3, "");

            code3 = p.StringToCode(inputdata3);

            image3Width = p.GetImage(code3).Width;

            image3Height = p.GetImage(code3).Height;

            widthArray[2] = image3Width;


            var htmlToPdf = new NReco.PdfGenerator.HtmlToPdfConverter();


            // set the size of the pdf
            int maxValue = (int)widthArray.Max();


            if ((image1Height + image2Height + image3Height) < 4000 / (float)3.2 && maxValue / (float)3.2 < 3000)
            {
                htmlToPdf.Size = PageSize.Default;
            }
            else
            {
                htmlToPdf.PageHeight = (image1Height + image2Height + image3Height) / (float)3.8;
                htmlToPdf.PageWidth = maxValue / (float)3.8;
            }

            //cteating the pdf
            var pdfBytes = htmlToPdf.GeneratePdf(htmltext);

            p.P(pdfBytes);


            if (ModelState.IsValid)
            {
                pdf.IdUser = User.GetUserId();
                pdf.PdfData = pdfBytes;
                _context.PDF.Add(pdf);
                _context.SaveChanges();

            }

            FileResult fileResult = new FileContentResult(pdfBytes, "application/pdf");

            fileResult.FileDownloadName = "Embroidery.pdf";
            

            Response.ContentType = "application/pdf";

            return pdfBytes;




        }
    }
}